import React from "react";
import "../components/body.scss";

export default function Body() {
  return (
    <div className = "body">
      <h3 className = "name"> Min Goo Jo </h3> 
      <h4> Junior Full Stack Developer </h4>
      <img className = "body--profileImage" src = "../../images/mgj.jpeg" alt = "MGJ"/>
      <h4> Languages </h4> 
      <div className = "body--language">
        <img className = "body--language__item" src = "../js.png" />
        <img className = "body--language__item" src = "../logo192.png" />
        <img className = "body--language__item"  src="../jquery.png" />
        <img className = "body--language__item"  src="../psql.png" />
      </div>
    </div>
  )

}
